DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `f_id` bigint NOT NULL COMMENT '主键',
  `f_code` varchar(50) NOT NULL COMMENT '用户代码或登录名',
  `f_name` varchar(50) NOT NULL COMMENT '姓名',
  `f_password` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `f_gender` tinyint NOT NULL COMMENT '性别(1:男,2:女,3:未知性别)',
  `f_sfzh` varchar(50) NOT NULL COMMENT '身份证号',
  `f_birthday` date NOT NULL COMMENT '出生日期',
  `f_dept_id` bigint NOT NULL COMMENT '所属部门id',
  `f_job_id` bigint NOT NULL COMMENT '职位id',
  `f_workstate_id` bigint NOT NULL COMMENT '工作状态id',
  `f_phone` varchar(50) DEFAULT NULL COMMENT '电话',
  `f_email` varchar(50) DEFAULT NULL COMMENT '电子邮箱',
  `f_sale` decimal(10,2) DEFAULT NULL COMMENT '薪水',
  `f_loves` varchar(100) DEFAULT NULL COMMENT '用户爱好id列表(使用逗号分割,例:1,2,3)',
  `f_photo` longblob COMMENT '照片',
  `f_photo_file` varchar(100) DEFAULT NULL,
  `f_additional_name` varchar(50) DEFAULT NULL COMMENT '附件名称',
  `f_additional_file` varchar(500) DEFAULT NULL COMMENT '附件文件路径名',
  `f_descr` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`f_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户表';

